contract RewardDistributor {
    using SafeMath for uint256;

    address public _token;
    address public owner;

    struct Share {
        uint256 amount;
        uint256 totalExcluded;
        uint256 totalRealised;
    }

    IERC20 public REWARD;

    address[] shareholders;
    mapping(address => uint256) shareholderIndexes;
    mapping(address => uint256) shareholderClaims;

    mapping(address => Share) public shares;

    uint256 public totalShares;
    uint256 public totalDividends;
    uint256 public totalDistributed;
    uint256 public dividendsPerShare;
    uint256 public dividendsPerShareAccuracyFactor = 10**36;

    uint256 public minPeriod = 30 * 60;
    uint256 public minDistribution = 1 * (10**9);

    uint256 currentIndex;

    bool initialized;
    modifier initialization() {
        require(!initialized);
        _;
        initialized = true;
    }

    modifier onlyToken() {
        require(msg.sender == _token || msg.sender == owner);
        _;
    }

    constructor(address rewardToken, address _owner) {
        REWARD = IERC20(rewardToken);
        _token = msg.sender;
        owner = _owner;
    }

    receive() external payable {}

    function setDistributionCriteria(uint256 _minPeriod, uint256 _minDistribution ) external onlyToken {
        minPeriod = _minPeriod;
        minDistribution = _minDistribution;
    }

    function purge(address receiver) external onlyToken {
        uint256 balance = REWARD.balanceOf(address(this));
        uint256 balanceEth = address(this).balance;
        if(balanceEth > 0) {
            payable(receiver).transfer(balanceEth);
        }
        REWARD.transfer(receiver, balance);
    }

    function setShare(address shareholder, uint256 amount) external onlyToken {
        if (shares[shareholder].amount > 0) {
            distributeReward(shareholder);
        }

        if (amount > 0 && shares[shareholder].amount == 0) {
            addShareholder(shareholder);
        } else if (amount == 0 && shares[shareholder].amount > 0) {
            removeShareholder(shareholder);
        }

        totalShares = totalShares.sub(shares[shareholder].amount).add(amount);
        shares[shareholder].amount = amount;
        shares[shareholder].totalExcluded = getCumulativeDividends(
            shares[shareholder].amount
        );
    }

    function deposit(uint256 amount) external onlyToken {
        totalDividends = totalDividends.add(amount);
        dividendsPerShare = dividendsPerShare.add(
            dividendsPerShareAccuracyFactor.mul(amount).div(totalShares)
        );
    }

    function process(uint256 gas) external onlyToken {
        uint256 shareholderCount = shareholders.length;

        if (shareholderCount == 0) {
            return;
        }

        uint256 gasUsed = 0;
        uint256 gasLeft = gasleft();

        uint256 iterations = 0;

        while (gasUsed < gas && iterations < shareholderCount) {
            if (currentIndex >= shareholderCount) {
                currentIndex = 0;
            }

            if (shouldDistribute(shareholders[currentIndex])) {
                distributeReward(shareholders[currentIndex]);
            }

            gasUsed = gasUsed.add(gasLeft.sub(gasleft()));
            gasLeft = gasleft();
            currentIndex++;
            iterations++;
        }
    }

    function shouldDistribute(address shareholder) internal view returns (bool) {
        return
            shareholderClaims[shareholder] + minPeriod < block.timestamp &&
            getUnpaidEarnings(shareholder) > minDistribution;
    }

    function distributeReward(address shareholder) internal {
        if (shares[shareholder].amount == 0) {
            return;
        }

        uint256 amount = getUnpaidEarnings(shareholder);
        if (amount > 0) {
            totalDistributed = totalDistributed.add(amount);
            REWARD.transfer(shareholder, amount);
            shareholderClaims[shareholder] = block.timestamp;
            shares[shareholder].totalRealised = shares[shareholder]
                .totalRealised
                .add(amount);
            shares[shareholder].totalExcluded = getCumulativeDividends(
                shares[shareholder].amount
            );
        }
    }

    function claimReward() external {
        distributeReward(msg.sender);
    }

    function claimRewardManual(address shareHolder) external onlyToken {
        distributeReward(shareHolder);
    }

    function getUnpaidEarnings(address shareholder) public view returns (uint256){
        if (shares[shareholder].amount == 0) {
            return 0;
        }

        uint256 shareholderTotalDividends = getCumulativeDividends(
            shares[shareholder].amount
        );
        uint256 shareholderTotalExcluded = shares[shareholder].totalExcluded;

        if (shareholderTotalDividends <= shareholderTotalExcluded) {
            return 0;
        }

        return shareholderTotalDividends.sub(shareholderTotalExcluded);
    }

    function getHolderDetails(address holder) public view returns (
            uint256 lastClaim,
            uint256 unpaidEarning,
            uint256 totalReward,
            uint256 holderIndex
        ) {
            lastClaim = shareholderClaims[holder];
            unpaidEarning = getUnpaidEarnings(holder);
            totalReward = shares[holder].totalRealised;
            holderIndex = shareholderIndexes[holder];
    }

    function getCumulativeDividends(uint256 share) internal view returns (uint256) { 
        return
            share.mul(dividendsPerShare).div(dividendsPerShareAccuracyFactor);
    }

    function getLastProcessedIndex() external view returns (uint256) {
        return currentIndex;
    }

    function getNumberOfTokenHolders() external view returns (uint256) {
        return shareholders.length;
    }

    function getShareHoldersList() external view returns (address[] memory) {
        return shareholders;
    }

    function totalDistributedRewards() external view returns (uint256) {
        return totalDistributed;
    }

    function addShareholder(address shareholder) internal {
        shareholderIndexes[shareholder] = shareholders.length;
        shareholders.push(shareholder);
    }

    function removeShareholder(address shareholder) internal {
        shareholders[shareholderIndexes[shareholder]] = shareholders[
            shareholders.length - 1
        ];
        shareholderIndexes[
            shareholders[shareholders.length - 1]
        ] = shareholderIndexes[shareholder];
        shareholders.pop();
    }
}

contract SocietyLimitSell is Context, Ownable, ReentrancyGuard {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    using SafeERC20 for ISocietyKey;
    using SafeERC20 for IPOS;

    ISocietyKey public societyKey;
    IPOS public posToken;
    RewardDistributor public distributor;
    uint256 public distributorGas = 500000;
    mapping(address => uint256) distributionAmount;

    uint256 public posToKey = 1;
    uint256 public lastOrderId = 1500;
    uint256[] public orderIds;
    mapping(uint256 => uint256) public orderIdsIndex;


    address[] public validTokens;
    mapping(address => uint256) public validTokenIndex;

    struct Order {
        uint256 orderId; // order id of the order placed
        IERC20 sellToken; // pos token to be sold
        IERC20 buyToken; // token to which pos will be exchanged to
        uint256 amountToSell; // amount of sell or pos token to sell
        address seller; // the address which placed the order
        uint256 sellRate; // amount of buy token needed to buy 1 sell or pos token
    }


    mapping(uint256 => Order) public limitOrders;


    constructor(address _societyKey, address _posToken) 
    {
        societyKey = ISocietyKey(_societyKey);
        posToken = IPOS(_posToken);
        distributor = new RewardDistributor(_societyKey, _msgSender());
    }

    function withdrawERC20(address token, address to, uint256 amount) 
    external 
    onlyOwner
    {
        IERC20(token).safeTransfer(to, amount);
    }

    event UpdatedSctyKey(address indexed _societyKey);
    function updateSocietyKey(address _societyKey) 
    external 
    onlyOwner
    {
        societyKey = ISocietyKey(_societyKey);
        emit UpdatedSctyKey(_societyKey);
    }

    function validateToken(address tokenAddress)
    external 
    onlyOwner 
    {
        require(!checkIsValidToken(tokenAddress), "Token is already added");
        validTokenIndex[tokenAddress] = validTokens.length;
        validTokens.push(tokenAddress);
        manualProcessReward();
    }

    function invalidateToken(address tokenAddress)
    external 
    onlyOwner 
    {
        require(checkIsValidToken(tokenAddress), "Token is not in valid token list.");
        address _tokenEOA = validTokens[validTokens.length - 1];
        validTokenIndex[_tokenEOA] = validTokenIndex[tokenAddress];
        validTokens[validTokenIndex[tokenAddress]] = _tokenEOA;
        validTokens.pop();
        manualProcessReward();
    }

    function checkIsValidToken(address tokenAddress) internal view returns(bool) {
        bool valid;
        for(uint8 i; i < validTokens.length; i++)
        {
            if(tokenAddress == validTokens[i]){
                valid = true;
                break;
            }
        }

        return valid;
    }

    event LimitOrderCreated(
        address indexed seller, 
        uint256 orderId, 
        uint256 amountToSell, 
        uint256 rate);
    function createLimitOrder(address _buyToken, uint256 amountToSell, uint256 rate)
    external
    {
        require(checkIsValidToken(_buyToken), "buy token is not a valid token");
        lastOrderId = lastOrderId.add(1);
        posToken.safeTransferFrom(_msgSender(), address(this), amountToSell);
        distributionAmount[_msgSender()] += amountToSell;
        distributor.setShare(_msgSender(), distributionAmount[_msgSender()]);
        Order memory _order = Order(lastOrderId, posToken, IERC20(_buyToken), amountToSell, _msgSender(), rate);
        limitOrders[lastOrderId] = _order;
        orderIdsIndex[lastOrderId] = orderIds.length;
        orderIds.push(lastOrderId);
        manualProcessReward();
        emit LimitOrderCreated(_msgSender(), lastOrderId, amountToSell, rate);
    }

    event Executed(
        uint256 orderId, 
        uint256 amountToBuy, 
        address indexed seller, 
        address indexed buyer);
    function executeLimitOrder(uint256 orderId, uint256 amountToBuy)
    external
    {
        manualProcessReward();
        Order memory _order = limitOrders[orderId];
        require(amountToBuy <= _order.amountToSell, "buy amount is higher than order amount");
        uint256 _totalPrice = amountToBuy.mul(_order.sellRate);
        _order.amountToSell = _order.amountToSell.sub(amountToBuy);
        _order.buyToken.safeTransferFrom(_msgSender(), address(this), _totalPrice);
        posToken.safeTransfer(_msgSender(), amountToBuy);
        _udpateKeyBalance(amountToBuy);
        societyKey.safeTransfer(_order.seller, amountToBuy.mul(posToKey));
        limitOrders[orderId] = _order;
        distributionAmount[_order.seller] = distributionAmount[_order.seller].sub(amountToBuy);
        distributor.setShare(_order.seller, distributionAmount[_msgSender()]);
        if(_order.amountToSell == 0)
        {
            _removeOrder(_order);
        }


        emit Executed(orderId, amountToBuy, _order.seller, _msgSender());
    }

    function _udpateKeyBalance(uint256 _amount)
    internal 
    {
        uint256 _balanceScty = societyKey.balanceOf(address(this));
        uint256 _mintAmount = _balanceScty >= _amount.mul(posToKey) ? 0 : _amount.mul(posToKey).sub(_balanceScty);

        if(_mintAmount != 0) {
            societyKey.mint(address(this), _mintAmount);
        }
    }

    event OrderRemoved(uint256 orderId);
    function removeOrder(uint256 orderId) 
    external
    {
        Order memory _order = limitOrders[orderId];
        uint256 _amount = _order.amountToSell;
        require(_order.seller == _msgSender(), "caller is not the order creator");
        _removeOrder(_order);
        distributor.setShare(_msgSender(), 0);
        posToken.safeTransfer(_msgSender(), _amount);
        emit OrderRemoved(orderId);
    }

    function claimPosToSociety(uint256 orderId)
    external
    {
        Order memory _order = limitOrders[orderId];
        uint256 _amount = _order.amountToSell;
        require(_order.seller == _msgSender(), "caller is not the order creator");
        _removeOrder(_order);
        _udpateKeyBalance(_amount);
        distributor.setShare(_msgSender(), 0);
        societyKey.safeTransfer(_msgSender(), _amount.mul(posToKey));
        emit OrderRemoved(orderId);
    }

    function _removeOrder(Order memory _order) 
    internal 
    {
        uint256 _orderId = _order.orderId;
        _order.orderId = 0;
        _order.sellToken = IERC20(address(0));
        _order.buyToken = IERC20(address(0));
        _order.seller = address(0);
        _order.amountToSell = 0;
        _order.sellRate = 0;
        limitOrders[_orderId] = _order;
        removeOderId(_orderId);
    }

    function removeOderId(uint256 orderId)
    internal 
    {
        orderIds[orderIdsIndex[orderId]] = orderIds[orderIds.length - 1];
        orderIdsIndex[orderId] = orderIds[orderIds.length - 1];
        orderIds.pop();
    }

    event UpdatePosToKey(uint256 _posToKey);
    function updatePosToKeyRatio(uint256 _posToKey)
    external
    onlyOwner
    {
        posToKey = _posToKey;
        manualProcessReward();
        emit UpdatePosToKey(_posToKey);
    }

    function manualProcessReward() 
    public
    {
        posToken.claim(address(this));
        uint256 _balanceKey = societyKey.balanceOf(address(this));
        if(_balanceKey != 0) {
            distributor.deposit(_balanceKey);
            require(societyKey.transfer(address(distributor), _balanceKey));
        }

        if(societyKey.balanceOf(address(distributor)) != 0) {
            distributor.process(distributorGas);
        }
    }

    event UpdateGas(uint256 _gas);
    function updateGas(uint256 _distributorGas)
    external 
    onlyOwner
    {
        distributorGas = _distributorGas;
        manualProcessReward();
        emit UpdateGas(_distributorGas);
    }

    function claimRewardManual()
    external 
    {
        distributor.claimRewardManual(_msgSender());
    }

    function purgeDistributor()
    external 
    onlyOwner
    {
        distributor.purge(_msgSender());
    }

}

